export interface GameDataFish {
  /** The fish id */
  id: number

  /** The fish name */
  name: string

  /** The fish rarity */
  rarity: number

  /** The fishing location for the fish */
  location: string

  /** Whether the fish can be caught in open water */
  openWater: boolean

  /** The holes the fish can be caught in */
  fishingHole: Array<string>

  /** The fish's favored bait */
  favoredBait:
    | 'Any'
    | 'Fish Egg'
    | 'Freshwater Minnow'
    | 'Glow Worm'
    | 'Lava Beetle'
    | 'Leech'
    | 'Lightning Bug'
    | 'Mackerel'
    | 'Nightcrawler'
    | 'Ramshorn Snail'
    | 'Sardine'
    | 'Scorpion'
    | 'Shrimpling'
    | 'Sparkfly Larva'

  /** The time of the day the fish can be caught in */
  timeOfDay: Array<'Any' | 'Day' | 'Night' | 'Dusk' | 'Dawn'>

  /** The fishing power required to catch the fish */
  fishingPower: number

  /** The fish main achievement info */
  achievement: {
    id: number
    name: string
    bit: number
  }

  /** The fish repeatable achievement info */
  avidAchievement: {
    id: number
    name: string
    bit: number
  }
}

